webpackJsonp([0x66dc0d935d65],{715:function(e,t){e.exports={data:{markdownRemark:{html:"<p>Hard luck don't go down easy<br>\nIt seizes up your wits<br>\nBut, I promise aint sleazy<br>\nTo hack it up to bits  </p>\n<p>Those that leave it up to Nature<br>\nTo bargain Fortune in their name<br>\nOften justify the torture<br>\nOften revel in the shame  </p>\n<p><em>Wayward Sister, get up off the floor</em><br>\n<em>Wayward Sister, step out the door</em>  </p>\n<p>Woke up between one and two<br>\nWho are you kidding, you never fell asleep<br>\nIn the tips of your fingers you can feel the doom<br>\nBeing laughed at by the sheep  </p>\n<p>Cooking, cleaning, smiling, scheming,<br>\nBreathing in a chicken room takes a toll<br>\nYou've spent years of daydreaming<br>\nChasing the fox out of its hole  </p>\n<p><em>Wayward Sister, get up off the floor</em><br>\n<em>Wayward Sister, step out the door</em>  </p>\n<p>Hitched up the hogs about a million times<br>\nYet what is there to show<br>\nMove to town, drop all your dimes<br>\nRush down there to earn some more  </p>\n<p>We can smell it when you enter<br>\nDon't deny the utter truth<br>\nYou've been made over by a blender<br>\nYou've been howling to the moon  </p>\n<p><em>Wayward Sister, get up off the floor</em><br>\n<em>Wayward Sister, step out the door</em>  </p>\n<p>Hard luck don't go down easy<br>\nIt suffocates your brain<br>\nBut, I promise aint sleazy<br>\nTo run away from all the pain  </p>\n<p>Nestle with us in the forest<br>\nWe eat and sing all of the time<br>\nLive like a transendentalistic tourist<br>\nIs being happy such a crime?  </p>\n<p><em>Wayward Sister, get up off the floor</em><br>\n<em>Wayward Sister, step out the door</em>  </p>\n<h2>Chords</h2>\n<pre><code>verse:\nc#m g# f# g#\n\nchorus:\nf# g# c#m\n</code></pre>",frontmatter:{title:"Wayward Sister"},fields:{date:null}}},pathContext:{slug:"/songs/wayward-sister/"}}}});
